To terminate a C program, you can use the `exit()` function or `return` statement in the `main()` function.

1. `exit()` function: This function causes immediate termination of the current process. It takes an integer argument, which is the exit status of the process. Here's an example:

```c
#include <stdlib.h>

int main() {
    // Your code here
    exit(0);
}
```

In the example above, the exit status is 0, which usually indicates successful termination.

2. `return` statement: You can use the `return` statement in the `main()` function to return a status code to the operating system. The `main()` function can return any integer value, but conventionally, 0 is used to indicate successful termination, and non-zero values are used to indicate an error. Here's an example:

```c
#include <stdio.h>

int main() {
    // Your code here
    if (some_condition) {
        printf("Error occurred\n");
        return 1;
    }
    return 0;
}
```

In the example above, if `some_condition` is true, the program will print an error message and return a status code of 1, indicating an error. If `some_condition` is false, the program will continue executing and return a status code of 0, indicating successful termination.
